import random
import time

# 本实验构造了一个生成器版，和一个不带生成器版，并分别调用，并比较了一下运行时间，带生成器版用时更多

# 不带生成器的版本
def generate_random_value(instance):
    if isinstance(instance, int):
        return random.randint(0, 1000)
    elif isinstance(instance, float):
        return random.uniform(0.0, 1000.0)
    elif isinstance(instance, str):
        return ''.join(random.choices('abcdefghijklmnopqrstuvwxyz', k=10))
    elif isinstance(instance, list):
        length = len(instance)
        return [random.randint(0, 1000) for _ in range(length)]
    elif isinstance(instance, dict):
        keys = list(instance.keys())
        return {key: random.randint(0, 1000) for key in keys}
    elif isinstance(instance, tuple):
        return tuple(random.randint(0, 100) for _ in range(10))
    else:
        return None

# 带生成器的版本
def generate_random_value_with_yield(instance):
    def generate_int():
        yield random.randint(0, 1000)

    def generate_float():
        yield random.uniform(0.0, 10000.0)

    def generate_str():
        yield ''.join(random.choices('abcdefghijklmnopqrstuvwxyz', k=10))

    def generate_list(instance):
        length = len(instance)
        yield [random.randint(0, 1000) for _ in range(length)]

    def generate_dict(instance):
        keys = list(instance.keys())
        yield {key: random.randint(0, 1000) for key in keys}

    def generate_tuple():
        yield tuple(random.randint(0, 100) for _ in range(10))

    if isinstance(instance, int):
        return list(generate_int())  # 执行生成器并返回列表
    elif isinstance(instance, float):
        return list(generate_float())  # 执行生成器并返回列表
    elif isinstance(instance, str):
        return list(generate_str())  # 执行生成器并返回列表
    elif isinstance(instance, list):
        return list(generate_list(instance))  # 执行生成器并返回列表
    elif isinstance(instance, dict):
        return list(generate_dict(instance))  # 执行生成器并返回列表
    elif isinstance(instance, tuple):
        return list(generate_tuple())  # 执行生成器并返回列表
    else:
        return None

# 装饰器函数，用于统计函数执行时间
def stats_decorator(func):
    def wrapper(*args, **kwargs):
        start_time = time.time()
        result = func(*args, **kwargs)
        end_time = time.time()
        print(f"\n函数 {func.__name__} 执行耗时 {end_time - start_time:.4f} 秒")
        return result
    return wrapper

# 统计并打印每种输入类型的个数及生成的随机数
def print_statistics(test_instance):
    type_counts = {
        'list': 0,
        'float': 0,
        'str': 0,
        'dict': 0,
        'tuple': 0,
        'int': 0,
        'other': 0
    }

    for instance in test_instance:
        if isinstance(instance, list):
            type_counts['list'] += 1
        elif isinstance(instance, float):
            type_counts['float'] += 1
        elif isinstance(instance, str):
            type_counts['str'] += 1
        elif isinstance(instance, dict):
            type_counts['dict'] += 1
        elif isinstance(instance, tuple):
            type_counts['tuple'] += 1
        elif isinstance(instance, int):
            type_counts['int'] += 1
        else:
            type_counts['other'] += 1

    print("输入类型统计：")
    for type_name, count in type_counts.items():
        if count > 0:
            print(f"{type_name}: {count}")

    print("\n--------------------------------------------\n")
    return type_counts

# 主程序
if __name__ == '__main__':
    # 生成大量数据
    test_instance = [
        ["test", "hello"],
        {"key1": 1, "key2": 2},
        (1, 2, 3),
        100,
        3.14,
        "example"
    ] * 500

    # 打印每种类型的个数
    type_counts = print_statistics(test_instance)

    # 使用不带生成器的版本
    @stats_decorator
    def test_generate_random_value():
        generated_values = []
        for instance in test_instance:
            generated_values.append(generate_random_value(instance))
        return generated_values

    generated_values = test_generate_random_value()
    print("生成的随机数：", generated_values)

    print("\n--------------------------------------------\n")

    # 使用带生成器的版本
    @stats_decorator
    def test_generate_random_value_with_yield():
        generated_values = []
        for instance in test_instance:
            generated_values.append(generate_random_value_with_yield(instance))
        return generated_values

    generated_values = test_generate_random_value_with_yield()
    print("生成的随机数：", generated_values)

